import React, { useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const sectionStyle = {
  marginBottom: '3rem',
};

const technicalSkills = [
  { name: 'HTML', img: '/icons/html.png' },
  { name: 'CSS', img: '/icons/css.png' },
  { name: 'JavaScript', img: '/icons/javascript.png' },
  { name: 'React', img: '/icons/react.png' },
  { name: 'Node.js', img: '/icons/node.png' },
  { name: 'Python', img: '/icons/python.png' },
  { name: 'MySQL', img: '/icons/mysql.png' },
  { name: 'WordPress', img: '/icons/wordpress.png' },
  { name: 'Bootstrap', img: '/icons/bootstrap.png' },
  { name: 'Git', img: '/icons/git.png' },
];

const Home = () => {
  useEffect(() => {
    const sections = document.querySelectorAll('section');
    const options = {
      threshold: 0.1,
    };

    const observer = new IntersectionObserver((entries) => {
      entries.forEach((entry) => {
        if (entry.isIntersecting) {
          entry.target.classList.add('fade-in');
        }
      });
    }, options);

    sections.forEach((section) => {
      observer.observe(section);
    });

    return () => {
      sections.forEach((section) => {
        observer.unobserve(section);
      });
    };
  }, []);

  return (
    <div className="container text-white" style={{ paddingTop: '3rem' }}>
      {/* Technical Skills */}
      <section id="technical-skills" style={sectionStyle}>
        <h2>Technical Skills</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '1.5rem',
            justifyContent: 'center',
            alignItems: 'center',
            marginBottom: '1rem',
          }}
        >
          {technicalSkills.map((skill, i) => (
            <div
              key={skill.name}
              style={{
                textAlign: 'center',
                width: 100,
                color: '#eee',
                cursor: 'default',
                transition: 'transform 0.3s ease',
                animation: 'fadeSlideIn 0.6s forwards',
                animationDelay: `${0.1 * i}s`,
                opacity: 0,
              }}
              title={skill.name}
              onMouseEnter={(e) => (e.currentTarget.style.transform = 'scale(1.1)')}
              onMouseLeave={(e) => (e.currentTarget.style.transform = 'scale(1)')}
            >
              <img
                src={skill.img}
                alt={skill.name}
                style={{
                  width: 70,
                  height: 70,
                  objectFit: 'contain',
                  marginBottom: '0.5rem',
                }}
              />
              <div style={{ fontSize: '1rem', fontWeight: '600' }}>{skill.name}</div>
            </div>
          ))}
        </div>
      </section>

      {/* Professional Development */}
      <section id="professional-development" style={sectionStyle}>
        <h2>Professional Development</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '2rem',
            justifyContent: 'center',
          }}
        >
          {[
            {
              name: 'Professional Year (Oct 2022 â€“ Apr 2023), Performance Education',
              img: '/logo/pe.png',
              alt: 'Performance Education',
            },
            { name: 'AWS Cloud Practitioner Essentials, AWS Training', img: '/logo/aws.png', alt: 'AWS' },
            { name: 'Google Professional Cloud Developer Certificate', img: '/logo/gcpd.png', alt: 'Google Cloud' },
            { name: 'Business Analysis and Process Management, Coursera', img: '/logo/c.png', alt: 'Coursera' },
            { name: 'Marketing Tools: Social Media, LinkedIn Learning', img: '/logo/linkedin.png', alt: 'LinkedIn Learning' },
            { name: 'Software Development Analytics Certification, SAS', img: '/logo/sas.png', alt: 'SAS' },
            { name: 'Web Page Development Certification, Alison', img: '/logo/alison.jpg', alt: 'Alison' },
            { name: 'Database Foundations, LinkedIn Learning', img: '/logo/linkedin.png', alt: 'LinkedIn Learning' },
            { name: 'Salesforce Developer AI Introduction, Alison', img: '/logo/alison.jpg', alt: 'Alison' },
            {
              name: 'Diploma in HTML5, CSS3, JavaScript and Python, Alison',
              img: '/logo/alison.jpg',
              alt: 'Alison',
            },
          ].map((cert, i) => (
            <div
              key={cert.name}
              style={{
                display: 'flex',
                alignItems: 'center',
                backgroundColor: '#222',
                borderRadius: '8px',
                padding: '1rem 1.5rem',
                width: '320px',
                boxShadow: '0 0 15px rgba(255,255,255,0.1)',
                transition: 'transform 0.3s ease',
                cursor: 'default',
                opacity: 0,
                animation: 'fadeSlideIn 0.7s forwards',
                animationDelay: `${0.1 * i}s`,
              }}
              onMouseEnter={(e) => (e.currentTarget.style.transform = 'scale(1.1)')}
              onMouseLeave={(e) => (e.currentTarget.style.transform = 'scale(1)')}
              title={cert.name}
            >
              <img
                src={cert.img}
                alt={cert.alt}
                style={{
                  height: 50,
                  marginRight: '1rem',
                  objectFit: 'contain',
                  borderRadius: 4,
                }}
              />
              <span style={{ fontSize: '1rem', color: '#eee', fontWeight: '600' }}>{cert.name}</span>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
};

export default Home;
